import React from 'react'

function Chart() {
  const labels = newXAxisData;
  const data = {
    labels: labels,
    datasets: [{
      label: 'My First Dataset',
      data: newYAxisData,
      fill: false,
      borderColor: 'rgb(75, 192, 192)',
      tension: 0.1
    }]
  };
  return (
    <div style={{ maxWidth: "800px", margin: "0 auto" }}>
      <Line data={data} />
    </div>
  );
}

export default Chart


